import React, { Component } from 'react';
import './Karsilama.css';
import image from './stars.jpg'

class Karsilama extends Component {
    render() {
        return (
          
            <ImageBackground source={image} style={{width: '100%', height: '100%'}}>
            <Text>Inside</Text>
          </ImageBackground>

        )
    }
}
export default Karsilama;
